import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
    mainview: {
        flex: 1,
        alignItems: "center",
        marginLeft: 25,
        marginRight: 25
    },
    bookpicker: {
        height: 50,
        width: 150,
        marginBottom: 20
    },
    chapterpicker: {
        height: 50,
        width: 150,
        marginBottom:30
    },
    buttons: {
        paddingBottom:100
    },
    headers: {
        textAlign: "center",
        fontSize: 32,
        marginBottom: 20,
    }
});
